!        Compute Cosine and Sine by recursion 
         Sine(0)  =Zero
         Cosine(0)=One 
         PQxy=DSQRT(PQx2+PQy2) 
         IF(PQxy/=Zero)THEN  
            OneOvPQxy=One/PQxy 
            Sine(1)  =PQx*OneOvPQxy  
            Cosine(1)=PQy*OneOvPQxy 
         ELSE 
            Sine(1)  =0.70710678118654752D0 
            Cosine(1)=0.70710678118654752D0 
