      SUBROUTINE IrRegular212(PQx,PQy,PQz,Cpq,Spq)
         IMPLICIT NONE
         REAL*8 Cpq(0:119),Spq(0:119),LegendreP(0:119)
         REAL*8 Sine(0:14),Cosine(0:14),CoFact(2:14)
         REAL*8 PQx,PQy,PQz,PQ2,pqx2,pqy2,pqxy,PQ
